import "./uperheader.css";

import Button from '@mui/material/Button';


const UpHeader = () => {
    return (
        <>

           <div className="col-12">
               <div className=" d-flex bg-dark p-2 text-white justify-content-between">
                   <p>shyam</p>
               </div>
           </div>
            

        </>
    )
}
export default UpHeader
